var 索敌距离 = 500 + _parent.技能等级 * 5;
var 是否强行重新索敌 = true;
var 优先索敌属性 = "距离";
var 优先索敌排序 = "顺序";
var 是否追踪 = true;
var 敌人顺序 = 0;
if(_root.控制目标 == _parent._name){
	//if(Key.isDown(_root.武器变形键)){
		//是否强行重新索敌 = true;
	//}
	if(Key.isDown(_root.互动键)){
		优先索敌属性 = "血量";
		优先索敌排序 = "倒序";
	}
	if(Key.isDown(_root.奔跑键)){
		是否追踪 = false;
	}
}
var 追踪目标 = _parent.按距离索敌(索敌距离, 是否强行重新索敌, 优先索敌属性, 优先索敌排序);
if(!追踪目标){
	是否追踪 = false;
}

if(!_parent.攻击目标 || !_root.gameworld[_parent.攻击目标].hp >0){
	for(var i = 敌人顺序 + 1; i < _parent.索敌目标列表.length; i++){
		if(_parent.索敌目标列表[i].敌人.hp > 0){
			追踪目标 = _parent.索敌目标列表[i].敌人;
			_parent.攻击目标 = 追踪目标._name;
			敌人顺序 = i;
			break;
		}
	}
}

if(!_parent.攻击目标 || !_root.gameworld[_parent.攻击目标].hp >0){
